import React from 'react';

function Header() {
  return (
    <div class="jumbotron jumbotron-fluid">
      <div class="container">
        <h1 class="display-4">React Book Search</h1>
        <p class="lead">Search and Save Books of Interest</p>
      </div>
    </div>
  )
}

export default Header;
